    string svgPartTwo = "</text></svg>";

    // owner address
    address payable public owner;

    // mapping
    mapping(string => string) public domains;
    mapping(string => string) public records;
    mapping(uint => string) public names;
    mapping(address => bool) public isRegistered;
    mapping(address => string) public dids;
    mapping(string => address) public addrs;
    mapping(string => VcInfo[]) public vcs;

    // event
    event DNSCreated(string name, string symbol, address owner);
    event Registered(address to, string did, string name, bool isRegistered);
    event UpdateVc(string did, string name, string cid);
    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );

    modifier onlyOwner() {
        require(isOwner());
        _;
    }

    /**
     * constuctor
     */
    constructor() payable ERC721("DID Name Service", "DNS") {
        // owner address
        owner = payable(msg.sender);

        console.log("owner:", owner);
        emit DNSCreated("DID Name Service", "DNS", owner);
    }

    /**
     * register
     * @param name domain
     * @param did did
     * @param to address
     */
    function register(
        string calldata name,
        string calldata did,
        address to
    ) public {
        // check
        require(valid(name), "invalid domain name check length");
        require(!isRegistered[to], "This address is already registered!!");

        // name
        string memory _name = string(abi.encodePacked(name));
        // create image data
        string memory finalSvg = string(
            abi.encodePacked(svgPartOne, _name, svgPartTwo)
        );
        //get token ID
        uint256 newRecordId = _tokenIds.current();
        uint256 length = StringUtils.strlen(name);
        string memory strLen = Strings.toString(length);

        // encode
        string memory json = Base64.encode(
            abi.encodePacked(
                '{"name": "',
                _name,
                '", "description": "A domain on the Ninja name service", "image": "data:image/svg+xml;base64,',
                Base64.encode(bytes(finalSvg)),
                '","length":"',
                strLen,
                '"}'
            )
        );
        // generate URI
        string memory finalTokenUri = string(
            abi.encodePacked("data:application/json;base64,", json)
        );

        // register
        domains[name] = did;
        records[did] = name;
        names[newRecordId] = name;
        dids[to] = did;
        addrs[did] = to;
        isRegistered[to] = true;

        // mint NFT
        _safeMint(to, newRecordId);
        // token URO
        _setTokenURI(newRecordId, finalTokenUri);

        _tokenIds.increment();
        emit Registered(to, did, name, isRegistered[to]);
    }

    /**
     * get did method
     * @param name name
     * @return did did
     */
    function getDidInfo(
        string calldata name
    ) public view returns (string memory) {
        return domains[name];
    }

    /**
     * check owner
     */
    function isOwner() public view returns (bool) {
        return msg.sender == owner;
    }

    /**
     * gell all names
     */
    function getAllNames() public view returns (string[] memory) {
        string[] memory allNames = new string[](_tokenIds.current());
        for (uint i = 0; i < _tokenIds.current(); i++) {
            allNames[i] = names[i];
        }
        // 
        return allNames;
    }

    /**
     * check domain name
     */
    function valid(string calldata name) public pure returns (bool) {
        return StringUtils.strlen(name) >= 3 && StringUtils.strlen(name) <= 30;
    }

    /**
     * getVcs function
     * @param _did DID
     * @return vcs[_did] Verifiable Credentials
     */
    function getVcs(string memory _did) public view returns (VcInfo[] memory) {
        return vcs[_did];
    }

    /**
     * updatVc function
     * @param _did DID
     * @param _name VC Name
     * @param _cid VC's CID
     */
    function updateVc(
        string memory _did,
        string memory _name,
        string memory _cid
    ) public {
        // get Vcinfo
        VcInfo[] storage coll = vcs[_did];

        // puch new Vc info
        coll.push(VcInfo({name: _name, cid: _cid}));
        // register again
        vcs[_did] = coll;

        emit UpdateVc(_did, _name, _cid);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(
            newOwner != address(0),
            "Ownable: new owner is the zero address"
        );
        _transferOwnership(newOwner);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Internal function without access restriction.
     */
    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = owner;
        owner = payable(newOwner);
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

